import React from "react";
import { NavLink } from "react-router-dom";
import "../css/error.css";
import "../js/error";

const Error = () => {
    return (
        <div id="container">
            <div className="content">
                <h2>404</h2>
                <h4>oops! Page Not Found this website</h4>
                <p>The page you were looking for doesn't exists. You May have mistyped the address or the page may moved</p>
                <NavLink to="javascript:location.reload();">Reload Page</NavLink>
                <NavLink to="javascript:history.back();">Back to prevsious Page</NavLink>
            </div>
        </div>
    );
};
